jq is a command-line-tool to pipe outputs from json into pretty json or extract values. That's how jq can automate cli-applications. Basic jq jq -r removes " from strings. [] constructs array object constructor: {} e.g. jq '[ { "name:" .[].name, "id:" .[].id } ]' or: jq '[ .[] | { title, name } ]' input cleo list --output=json peers output [ { "name": "HelloPeer", "id": "90dfc639-4b4a-4bbb-bad3-6f037fcde013", "status": "Disconnected" }, { "name": "Edgar", "id": "defe10bb-a12a-4ad9-b18e-8149099dd044", "status": "Connected" }, { "name": "SecondPeer", "id": "c3333d4e-9b1a-4db5-9bfa-7a0a40680f1a", "status": "Disconnected" }
] input cleo list --output=json peers | jq '[.[].name]' output jq extracts the names of every json element in the list of peers. [ "HelloPeer", "Edgar", "SecondPeer" ] can also be put into an array with cleo list --output=json peers | jq '[.[].name'] input cleo list --output=json peers | jq '[.[] | select(.status=="Disconnected")]' output [ { "name": "HelloPeer", "id": "90dfc639-4b4a-4bbb-bad3-6f037fcde013", "status": "Disconnected" }, { "name": "SecondPeer", "id": "c3333d4e-9b1a-4db5-9bfa-7a0a40680f1a", "status": "Disconnected" }
] input cleo list --output=json peers | jq '.[] | select(.status=="Connected") | .id' | xargs -I{} cleo describe peer -i {} output Peer: Edgar Id: defe10bb-a12a-4ad9-b18e-8149099dd044 Devices: [device-1, The Device, Another Device, Fubar Device, Lost Device] to get the number of the peers cleo list --output=json peers | jq 'length' to sort peers by name cleo list --output=json peers | jq 'sort_by(.name)'

