In case you are working behind a http proxy, you need additional steps to get the test environment up and running. The following steps pick up just before you start up the virtual machine with vagrant up. A list of all domains used by the test environment is reflected in the proxy shell script: .ci/docker/vagrant/proxy.sh. It is important to note that the proxy address used shall be accessible from the host while provisioning and within the virtual machine. If you have a proxy server on your localhost you need to make this in two steps: Use proxy on your localhost Configure vagrant to use the proxy localhost. # proxy configuration script, adjust to your needs
source .ci/docker/vagrant/proxy.sh http://localhost:3128 Install proxy plugin for vagrant vagrant plugin install vagrant-proxyconf Then starting the VM without provisioning it. This should create the vagrant network interface with network range 192.168.56.0/24. vagrant up --no-provision Use proxy on private network address 192.168.56.1 Make sure this address is allowing access to the internet: curl --max-time 2 --connect-timeout 1 --proxy http://192.168.56.1:3128 google.de Redo the proxy configuration using the address of the host within the virtual machine's private network: # proxy configuration script, adjust to your needs
source .ci/docker/vagrant/proxy.sh http://192.168.56.1:3128 Reapply the configuration to the VM $ vagrant up --provision
